import { makeStyles } from '@material-ui/core/styles';

import { colors } from './common';

const useStyles = makeStyles({
    supportLink: {
        borderRadius: ".3em",
        backgroundColor: colors.secondary,
        color: colors.white,
        padding: ".25em",
        marginTop: "1.3em",
        margin: "1em 0 1em 0 ",
    },
});

function HomeSupportLinks() {
    const classes = useStyles();

    const sideBarData = [
        { title: "Review Us! Google",    link: "#" },
        { title: "Review Us! Yelp",      link: "#" },
        { title: "Follow Us! Instagram", link: "#" },
        { title: "Like Us! Facebook",    link: "#" },
    ];

    return (
      <div>
        {sideBarData.map((support) =>
          <h2 className={classes.supportLink}><a style={{color: colors.white, textDecoration: "none"}} href={support.link}>{support.title}</a></h2>
        )}
      </div>
    );
}

export default HomeSupportLinks;
